import Foundation

class Polymer : NSObject, NSCopying {
    let name : Character
    let reactor : Character
    var nextPolymer : Polymer?
    var prevPolymer : Polymer?
    
    public init(_ name : Character) {
        self.name = name
        let nameString = String(name)
        let lowercase = nameString.lowercased()[nameString.startIndex]
        if lowercase != name {
            reactor = lowercase
        } else {
            reactor = nameString.uppercased()[nameString.startIndex]
        }
    }
    
    convenience init(fromInput input: String) {
        self.init(day5_input[input.startIndex])
        
        var curPolymer : Polymer = self
        var index = input.index(after: input.startIndex)
        while index < input.endIndex {
            let p = Polymer(input[index])
            curPolymer.nextPolymer = p
            p.prevPolymer = curPolymer
            curPolymer = p
            index = input.index(after: index)
        }
    }
    
    func reactsWith(_ other : Polymer) -> Bool {
        return other.name == self.reactor
    }
    
    func reactsWithNext() -> Bool {
        if let next = self.nextPolymer {
            return self.reactsWith(next)
        } else {
            return false
        }
    }
    
    func description() -> String {
        return String(name)
    }
    
    func fullDescription() -> String {
        var str = String(name)
        var curPolymer = nextPolymer
        while curPolymer != nil {
            str.append(curPolymer!.name)
            curPolymer = curPolymer?.nextPolymer
        }
        return str
        
    }
    
    func count() -> Int {
        var count = 1
        var curPolymer = nextPolymer
        while curPolymer != nil {
            count += 1
            curPolymer = curPolymer?.nextPolymer
        }
        return count
    }
    
    func copy(with zone: NSZone? = nil) -> Any {
        let copy = Polymer(self.name)
        var curPolymer = self.nextPolymer
        var curCopy = copy
        while curPolymer != nil {
            let prevPolymer = curCopy
            curCopy.nextPolymer = Polymer(curPolymer!.name)
            curCopy = curCopy.nextPolymer!
            curCopy.prevPolymer = prevPolymer
            curPolymer = curPolymer?.nextPolymer
        }
        return copy
    }
    
    func reduce() -> Polymer {
        let polymer : Polymer = self.copy() as! Polymer
        var returnValue : Polymer = polymer
        var curPolymer : Polymer? = polymer
        var didReact = false
        while curPolymer != nil {
            if curPolymer?.reactsWithNext() ?? false {
                if curPolymer?.prevPolymer != nil {
                    curPolymer?.prevPolymer?.nextPolymer = curPolymer?.nextPolymer?.nextPolymer
                    curPolymer?.nextPolymer?.nextPolymer?.prevPolymer = curPolymer?.prevPolymer
                } else {
                    returnValue = (curPolymer?.nextPolymer?.nextPolymer)!
                    returnValue.prevPolymer = nil
                }
                didReact = true
            }
            
            if didReact {
                curPolymer = curPolymer?.prevPolymer ?? curPolymer?.nextPolymer?.nextPolymer
                didReact = false
            } else {
                curPolymer = curPolymer?.nextPolymer
            }
        }
        return returnValue
    }
}

class Day5_2018 : Day {
    public init() {
        super.init(dayNumber: 5)
        
        parts.append(DayPart.init(withBlock: self.part1))
        parts.append(DayPart.init(withBlock: self.part2))
    }

    func part1() -> String? {
        var polymer = Polymer(fromInput: day5_input)
        polymer = polymer.reduce()
        return "\(polymer.count())"
    }
    
    func part2() -> String? {
        var charCount : [Character : Int] = [:]
        for char in "abcdefghijklmnopqrstuvwxyz" {
            let uppercaseChar = String(char).uppercased()
            let charactersToRemove: [Character] = [char, uppercaseChar[uppercaseChar.startIndex]]
            let input = String(day5_input.filter { !charactersToRemove.contains($0) })
            var polymer = Polymer(fromInput: input)
            polymer = polymer.reduce()
            charCount[char] = polymer.count()
        }
        
        var bestCount = day5_input.count + 1
        var bestChar = Character("x")
        for (char, count) in charCount {
            if count < bestCount {
                bestCount = count
                bestChar = char
            }
        }
        return "\(bestChar): \(bestCount)"
    }
}

fileprivate let day5_input = ""
